<ul>
<li>mysql在超过wait_timeout后，主动断开连接</li>
<li>hikari的max-lifetime表示连接最大存活时间，若max-lifetime大于wait_timeout，连接已被关闭，导致连接不可用</li>
<li>故要保证max-lifetime小于wait_timeout</li>
</ul>
